package com.melonlee.api.bean;import java.util.ArrayList;public class ModuleBean {	private int id;	private String title;	private String createDate;	private int pID;	private String pName;	private String baseUrl;	private String descStr;	private ArrayList<FunctionBean> functions = new ArrayList<FunctionBean>();		public String getBaseUrl() {		return baseUrl;	}	public void setBaseUrl(String baseUrl) {		this.baseUrl = baseUrl;	}	public String getDescStr() {		return descStr;	}	public void setDescStr(String descStr) {		this.descStr = descStr;	}	public ArrayList<FunctionBean> getFunctions() {		return functions;	}	public void setFunctions(ArrayList<FunctionBean> functions) {		this.functions = functions;	}	public int getId() {		return id;	}	public void setId(int id) {		this.id = id;	}	public String getTitle() {		return title;	}	public void setTitle(String title) {		this.title = title;	}	public String getCreateDate() {		return createDate;	}	public void setCreateDate(String createDate) {		this.createDate = createDate;	}	public int getpID() {		return pID;	}	public void setpID(int pID) {		this.pID = pID;	}	public String getpName() {		return pName;	}	public void setpName(String pName) {		this.pName = pName;	}}